import React from 'react';
import "./styles.css";

function PlacesInfo({ places }) {
  return (
    <div className="places-info">
      <h2>Interesting Places</h2>
      <ul>
        {places.map((place) => (
          <li key={place.p}>
            <h4>{place.name}</h4>
            <p>{place.info.descr}</p>
          </li>
        ))}
      </ul>
    </div>
  );
}

export default PlacesInfo;
